import React from "react";
import PropTypes from "prop-types";
import { Provider } from "react-redux";
import ReservationStepsState from "../reservation/components/reservationStepsState";
import ReservationStepsNav from "../reservation/components/reservationStepsNav";
import ReservationStepsContainer from "../reservation/components/ReservationStepsContainer";
import "../css/App.scss";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Loader from '../loader/components';

function Root({ store }) {
  return (
    <div className="reservation-container">
      <Provider store={store}>
        <Router>
          <ReservationStepsState />
          <Loader/>
          <ReservationStepsContainer/>
          <ReservationStepsNav />
        </Router>
      </Provider>
    </div>
  );
}

Root.propTypes = {
  store: PropTypes.object.isRequired
};
export default Root;
